import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(welcome, document.getElementById('root'));

if(module.hot){
    module.hot.accept();
}

serviceWorker.unregister();
